INSERT INTO `reviews` VALUES (1,3,984,'semi-sec\r\ngout de seve\r\nfruite legerement\r\nasseche la bouche agreablement\r\n\r\nSuperbe avec poissons ou un dessert (tarte aux pommes)',1,'2009-09-29 01:07:14','2009-09-29 01:07:14'),(2,4,986,'eclatant en bouche\r\ntres agreable, savoureux',1,'2009-09-29 01:17:21','2009-09-29 01:17:21'),(3,2,1073,'assez souple\r\nmou en bouche\r\ndoit etre bu frais sinon un gout desagreable se fait sentir',1,'2009-09-29 01:18:04','2009-09-29 01:18:04'),(4,3,671,'Bonne odeur.\r\nA peine petillant: agreable\r\nGout de pomme un peu leger\r\n\r\nRafraichissant!',1,'2009-09-29 01:21:16','2009-09-29 01:21:16'),(5,4,3843,'Excellent vin à essayer absolument!',2,'2009-09-29 01:28:31','2009-09-29 01:28:31'),(6,4,12,'Aperitif a la fois amer et sucre, avec un peu de zeste d\'orange. Exactement ce que j\'aime.\r\n\r\nSur glaces, voila mon aperitif prefere depuis des annees! \r\n\r\nTres abordable, et tres peu connu, car souvent lorsque je demande ca dans un resto, on ne sait pas de quoi il s\'agit!',1,'2009-09-29 01:51:09','2009-10-04 20:44:20'),(7,3,1470,'***1/2.  Fort en bouche, à boire avec des viandes rouges bien rehaussées ou des fromages forts.',2,'2009-09-29 01:57:32','2009-09-29 01:57:32'),(8,4,751,'C\'est vraiment mon vin préféré, assez corsé, je l\'utilise un peu partout assez souvent!',2,'2009-10-02 13:32:55','2009-10-02 13:32:55'),(9,4,5334,'J\'y ai gouté avec de l\'omble et potiron. Je vais définitement l\'essayer à nouveau.',5,'2009-10-04 02:10:26','2009-10-04 02:21:01'),(10,3,575,'Correct pour le prix',5,'2009-10-04 02:11:48','2009-10-04 02:20:11'),(11,2,2365,'nez: tres agreable: cuir, champignon, prunes et un chouya de vanille.\r\n\r\nbouche: tanins presents, mais manque de rondeur, de complexite. Petite note d\'amertume sur la fin.\r\n\r\nconclusion: pas genial, et beaucoup trop cher.',1,'2009-10-04 20:38:22','2009-10-04 20:38:22'),(12,5,2654,'Perfect match with sous-vide orange duck, served with foie gras sauce and wild mushrooms. Not overpowering, but solid, well structured.',7,'2009-10-04 21:04:17','2009-10-04 21:04:17'),(13,3,3551,'nez: gazon, humidite et cuir.\r\n\r\nbouche: biscuit, champignon, tanins.\r\n\r\nDeguste chez BU. Tres bon!',1,'2009-10-04 21:53:21','2009-10-04 21:53:21'),(14,4,124,'nez: poire, aromes tres agreables.\r\n\r\nbouche: miel, petit piquant. presque sec, complexe!\r\n\r\nconclusion: Excellent! Un vrai plaisir!',1,'2009-10-04 21:57:20','2009-10-04 21:57:20'),(15,2,2365,'Cet assemblage 2005 de Sangiovese, Syrah, Cabernet Sauvignon et Cabernet Franc  paraissait enjôleur mais est finalement décevant.  Sans trop de personnalité.  Passez au suivant!',6,'2009-10-06 02:58:50','2009-10-06 02:58:50'),(16,3,2799,'Excellent rapport qualite / prix. Robe ruby foncee, bonne bouche avec un gout reglisse.',7,'2009-10-10 18:28:06','2009-10-10 18:33:03'),(17,3,526,'Tasted the 2006 vintage',7,'2009-10-10 18:30:41','2009-10-10 18:30:41'),(18,3,93,'Nez fleuri, goût prononcé de petits fruits.',2,'2009-10-13 01:31:38','2009-10-13 01:31:38'),(19,4,3264,'Bien corsé, vraiment un grand cru.  (Remarquez que j\'ai goûté au 2000 et non au 2001...)',2,'2009-10-13 01:33:38','2009-10-13 01:33:38');
/*!40000 ALTER TABLE `reviews` ENABLE KEYS */;
